import React from 'react'
import { TweetBody } from './TweetBody'


class Feed extends Component {
    constructor(props) {
        super(props)
        this.state = {}
    }


    render() {
        return (
            <div className="main-body">
                <TweetBox
                    name="Karthik Kalyan"
                    handle="@karthikkalyan90"
                    tweet="hello world hello worldhello worldhello worldhello" />
            </div>
        );
    }
}

export default Feed
